import React from "react";
import {Link} from 'react-router-dom';

//import css
import './home.css'

export const Home = () => {
    return(
        <>
            <nav className = 'nav_home'>
                <a href="">Henry Dogs</a>
                    <h1 className = 'title_nav_home'>Henry Dogs</h1>
                <Link to = '/add'>
                    <p className = 'p_nav_home'>Agregar raza</p>
                </Link>
            </nav>
        </>
    )
}
